    const barWidth = '50%';
    return (
        <div>
            <div className="progress-back" style={{
                background: 'rgba(0,0,0,0.2)',
                width: '200px',
                height: '20px',
                borderRadius:'10px'
                }}>
                <div className="progress-bar" style={{
                    background: '#fes5196',
                    width: barWidth,
                    height: '50%',
                    borderRadius:'10px'
                    }}>
                </div>
            </div>
        </div>
    )
}

ReactDOM.render( 
    <div>
